import React, { useState } from "react";
import "./Portfolio.css";

function App() {
  const [currentPage, setCurrentPage] = useState("about");

  const handlePageChange = page => {
    setCurrentPage(page);
  };

  return (
    <div className="portfolio">
      <header>
        <nav>
          <ul className="header-nav">
            <li
              className={`header-nav-item ${
                currentPage === "about" ? "active" : ""
              }`}
              onClick={() => handlePageChange("about")}
            >
              About
            </li>
            <li
              className={`header-nav-item ${
                currentPage === "projects" ? "active" : ""
              }`}
              onClick={() => handlePageChange("projects")}
            >
              Projects
            </li>
            <li
              className={`header-nav-item ${
                currentPage === "contact" ? "active" : ""
              }`}
              onClick={() => handlePageChange("contact")}
            >
              Contact
            </li>
          </ul>
        </nav>
      </header>

      <main>
        {currentPage === "about" && (
          <section className="about">
            <h2 className="section-title">About Me</h2>
            <p className="section-text">
              Hi, I'm a full-stack developer with a passion for building
              scalable and user-friendly web applications. I have experience
              using technologies such as React.js, Node.js, and MongoDB.
            </p>
          </section>
        )}

        {currentPage === "projects" && (
          <section className="projects">
            <h2 className="section-title">Projects</h2>
            <ul className="project-list">
              <li className="project-item">Project 1</li>
              <li className="project-item">Project 2</li>
              <li className="project-item">Project 3</li>
            </ul>
          </section>
        )}

        {currentPage === "contact" && (
          <section className="contact">
            <h2 className="section-title">Contact</h2>
            <form className="contact-form">
              <label htmlFor="name" className="form-label">
                Name:
              </label>
              <input
                type="text"
                id="name"
                name="name"
                className="form-input"
              />

              <label htmlFor="email" className="form-label">
                Email:
              </label>
              <input
                type="email"
                id="email"
                name="email"
                className="form-input"
              />

              <label htmlFor="message" className="form-label">
                Message:
              </label>
              <textarea id="message" name="message" className="form-input"></textarea>

              <button type="submit" className="form-submit">
        Submit
      </button>
    </form>
  </section>
)}
</main>

<footer>
<p className="footer-text">
  &copy; {new Date().getFullYear()} Portfolio
</p>
</footer>
</div>
);
}

export default Portfolio;




